    const { avatar, fullName } = props;

    return (
        <StyledTierDetail>
            <div className="avatar">
                <div className="image">{/* <img src={avatar} /> */}</div>
                <div className="info">
                    <div className="name">{fullName}</div>
                </div>
            </div>
        </StyledTierDetail>
    );
};

const StyledTierDetail = styled.div``;
